Welcome to Al's Action English!

Here you will find all kinds of lessons, tips and advice about English, Languages and Accents.

Let me know what topics YOU would like covered and what videos you want to see more of. 

Contact me if you're looking for any of these services:

1. Northern Irish Accent Classes;
2. English and Maths Lessons;
3. Professional Audio Recording;
4. Proofreading.

Subscribe, share and don't forget to hit the notification bell for more no-nonsense videos.

